import React from 'react'
import { useSelector } from 'react-redux'
import { Typography } from '@mui/material';
import { Link } from 'react-router-dom';
import '@fontsource/roboto';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';

const Product = () => {

    const products = useSelector((state) => state.allProducts.products);
    const renderList = products.map((product) => {

        const { id, title, image, price, category } = product;

        return (


            <Box
                sx={{
                    display: 'flex',
                    flexWrap: 'wrap',
                    '& > :not(style)': {
                        m: 1,
                        width: 400,
                        height: 600,
                    },
                }}
            >
                <Paper elevation={5} aling="center" style={{marginRight: "auto", marginTop: "50px", marginBottom: "80px"}} >
                <img src={image} alt={title} style={{  width: "300px", height: "350px",margin: "inherit", marginLeft: "30px" }}></img>
                </Paper>
                <Paper elevation={5} style={{ marginTop: "50px"}} >
                <img src={image} alt={title} aling="center" style={{  width: "300px", height: "350px",margin: "inherit", marginLeft: "30px" }}></img>
                </Paper>
            </Box>


        );
    })


    return <>{renderList}</>;

}


export default Product
